@mixin col {
  @media (max-width: 576px) {
    @content;
  }
}

@mixin sm {
  @media (max-width: 767px) {
    @content;
  }
}

@mixin md-minus {
  @media (max-width: 991px) {
    @content;
  }
}

@mixin md {
  @media (max-width: 992px) {
    @content;
  }
}

@mixin lg-minus {
  @media (max-width: 1199px) {
    @content;
  }
}

@mixin lg {
  @media (max-width: 1200px) {
    @content;
  }
}

@mixin extra {
  @media (max-width: 1400px) {
    @content;
  }
}

@mixin xl {
  @media (min-width: 1200px) {
    @content;
  }
}


@mixin font ($font-family, $font-size, $color) {
  font-family: $font-family;
  font-size: $font-size;
  color: $color;
}

@mixin ellipsis ($line) {
  overflow: hidden;
  display: -webkit-box;
  -webkit-line-clamp: $line;
  -webkit-box-orient: vertical;
  text-overflow: ellipsis;
  white-space: normal;
}

@mixin font-size {
  font-size: 18px;

  @include lg {
    font-size: 16px;
  }
}

@mixin prev {
  border-radius: 50%;
  width: 35px;
  height: 35px;
  top: 50%;
  left: -20px;
